import React, { Component } from "react";
import NavigationDrawerStructure from "./main2";
import {
  View,
  Text,
  ScrollView,
  StyleSheet,
  Image,
  TouchableOpacity,
  Dimensions,
} from "react-native";
import Icon from "./icons";
import * as Font from "expo-font";
import { connect } from "react-redux";
import { LinearGradient } from "expo-linear-gradient";
const mainColor = "#fc0f84";
const bgcolor = "#F1EEFc";
const { width } = Dimensions.get("window");
var screenHeight = Math.round(Dimensions.get("window").height) / 100;
var screenWidth = Math.round(Dimensions.get("window").width) / 100;
export default class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      size: { width, height: 150 },
      fontsLoaded: false,
    };
  }

  loadFonts() {
    return Font.loadAsync({
      "Poppins-Light": require("./assets/fonts/Poppins-Light.ttf"),
      "Poppins-Medium": require("./assets/fonts/Poppins-Medium.ttf"),
      "Poppins-Bold": require("./assets/fonts/Poppins-Bold.ttf"),
      "Poppins-Regular": require("./assets/fonts/Poppins-Regular.ttf"),
    });
  }
  _renderBannerItems(rowData) {
    return (
      <TouchableOpacity
        style={{ paddingHorizontal: 5 }}
        onPress={() => this.props.navigation.navigate("Giftcard")}
      >
        <Image
          source={rowData.item.img}
          style={{ width: 350, height: 120, resizeMode: "stretch" }}
        />
      </TouchableOpacity>
    );
  }
  async componentDidMount() {
    //console.log("home scree", this.props);
    //  BackHandler.addEventListener("hardwareBackPress", this.handleBackButton);
    await this.loadFonts();
    this.setState({ fontsLoaded: true });
  }

  render() {
    if (this.state.fontsLoaded) {
      return (
        <View
          style={{ flex: 1, backgroundColor: bgcolor, flexDirection: "row" }}
        >
          <ScrollView>
            <LinearGradient
              colors={["#fc0f84", "#020cab"]}
              start={{ x: 1, y: 0 }}
              end={{ x: 0, y: 1 }}
              style={styles.linerSty}
            >
              <TouchableOpacity
                onPress={() => this.props.navigation.openDrawer()}
                style={{
                  flex: 1,
                  marginTop: screenHeight * 5,
                  marginLeft: screenWidth * 2,
                  //   marginRight: "6%",
                }}
              >
                {/*Donute Button Image */}
                <Icon family="FontAwesome" name="bars" size={26} color="#FFF" />
              </TouchableOpacity>

              <View style={styles.headerContainer}>
                <View
                  style={{
                    flexDirection: "row",
                  }}
                >
                  <View style={styles.userImg}>
                    <Image
                      style={styles.imgSty}
                      source={require("./assets/profile.jpeg")}
                    />
                  </View>

                  <View
                    style={{
                      padding: 10,
                      marginLeft: "4%",
                      marginTop: screenHeight * 4,
                    }}
                  >
                    <Text
                      style={{
                        fontSize: 20,
                        color: "#FFF",
                        fontFamily: "Poppins-Light",
                      }}
                    >
                      Hetan
                    </Text>
                    <Text
                      style={{ color: "#FFF", fontFamily: "Poppins-Light" }}
                    >
                      hetanthakkar1@gmail.com
                    </Text>
                  </View>
                </View>
                <View style={{ margin: 10 }}>
                  <TouchableOpacity
                    onPress={() => this.props.navigation.navigate("Notifi")}
                  >
                    <Icon
                      family="FontAwesome"
                      name="bell-o"
                      size={23}
                      color="#FFF"
                    />
                    <Text style={styles.notifisty}>2</Text>
                  </TouchableOpacity>
                </View>
              </View>
            </LinearGradient>
            <View style={[styles.transferbox, { marginTop: -75 }]}>
              <View style={styles.balance}>
                <Text style={styles.curSty}>Current Balance</Text>
                <Text style={styles.balSty}>$ 1200</Text>
              </View>
              <View
                style={{
                  flex: 1,
                  flexDirection: "row",
                }}
              >
                <View style={{ flex: 0.25, margin: 10, marginLeft: 20 }}>
                  <TouchableOpacity
                    onPress={() => this.props.navigation.openDrawer()}
                  >
                    <LinearGradient
                      colors={["#fc0f84", "#020cab"]}
                      start={{ x: 1, y: 0 }}
                      end={{ x: 0, y: 1 }}
                      style={styles.gradsty}
                    >
                      <View style={{ padding: 5, alignItems: "center" }}>
                        <View style={styles.transfer}>
                          <Icon family="FontAwesome" name="codepen" size={20} />
                        </View>
                      </View>
                    </LinearGradient>
                    <Text style={styles.paytypesty}>Teach</Text>
                  </TouchableOpacity>
                </View>
                <View style={{ flex: 0.25, margin: 10, marginLeft: 20 }}>
                  <TouchableOpacity
                    onPress={() => this.props.navigation.openDrawer()}
                  >
                    <LinearGradient
                      colors={["#fc0f84", "#020cab"]}
                      start={{ x: 1, y: 0 }}
                      end={{ x: 0, y: 1 }}
                      style={styles.gradsty}
                    >
                      <View style={{ padding: 5, alignItems: "center" }}>
                        <View style={styles.transfer}>
                          <Icon family="FontAwesome" name="codepen" size={20} />
                        </View>
                      </View>
                    </LinearGradient>
                    <Text style={styles.paytypesty}>Add Skills</Text>
                  </TouchableOpacity>
                </View>

                <View style={{ flex: 0.25, margin: 10 }}>
                  <TouchableOpacity
                    onPress={() =>
                      this.props.navigation.navigate("ReceiveContacts")
                    }
                  >
                    <LinearGradient
                      colors={["#fc0f84", "#020cab"]}
                      start={{ x: 1, y: 0 }}
                      end={{ x: 0, y: 1 }}
                      style={styles.gradsty}
                    >
                      <View style={{ padding: 5, alignItems: "center" }}>
                        <View style={styles.transfer}>
                          <Icon family="AntDesign" name="book" size={23} />
                        </View>
                      </View>
                    </LinearGradient>
                    <Text style={styles.paytypesty}>Learn</Text>
                  </TouchableOpacity>
                </View>
                <View style={{ flex: 0.25, margin: 10 }}>
                  <TouchableOpacity
                    onPress={() =>
                      this.props.navigation.navigate("MoblieRecharge")
                    }
                  >
                    <LinearGradient
                      colors={["#fc0f84", "#020cab"]}
                      start={{ x: 1, y: 0 }}
                      end={{ x: 0, y: 1 }}
                      style={styles.gradsty}
                    >
                      <View style={{ padding: 5, alignItems: "center" }}>
                        <View style={styles.transfer}>
                          <Icon family="AntDesign" name="wallet" size={22} />
                        </View>
                      </View>
                    </LinearGradient>
                    <Text style={styles.paytypesty}>Wallet</Text>
                  </TouchableOpacity>
                </View>
                <View style={{ flex: 0.25, margin: 10 }}>
                  <TouchableOpacity
                    onPress={() => this.props.navigation.navigate("Map")}
                  >
                    <LinearGradient
                      colors={["#fc0f84", "#020cab"]}
                      start={{ x: 1, y: 0 }}
                      end={{ x: 0, y: 1 }}
                      style={styles.gradsty}
                    >
                      <View style={{ padding: 5, alignItems: "center" }}>
                        <View style={styles.transfer}>
                          <Icon family="Feather" name="map" size={20} />
                        </View>
                      </View>
                    </LinearGradient>
                    <Text style={styles.paytypesty}>Around Me</Text>
                  </TouchableOpacity>
                </View>
              </View>
            </View>
            <View style={{ marginVertical: 15 }}>
              <View style={styles.shoppingCotainer}>
                <TouchableOpacity style={styles.shoppingbody}>
                  <View style={styles.shoppingtxt}>
                    <Icon
                      family="MaterialIcons"
                      name="code"
                      size={20}
                      color={mainColor}
                    />
                  </View>
                  <Text style={styles.shoptxt}>Coding</Text>
                </TouchableOpacity>
                <TouchableOpacity style={styles.shoppingbody}>
                  <View style={styles.shoppingtxt}>
                    <Icon
                      family="MaterialCommunityIcons"
                      name="cash-multiple"
                      size={20}
                      color={mainColor}
                    />
                  </View>
                  <Text style={styles.shoptxt}>Digital Marketing</Text>
                </TouchableOpacity>
                <TouchableOpacity style={styles.shoppingbody}>
                  <View style={styles.shoppingtxt}>
                    <Icon
                      family="MaterialIcons"
                      name="mic"
                      size={20}
                      color={mainColor}
                    />
                  </View>
                  <Text style={styles.shoptxt}>Singing</Text>
                </TouchableOpacity>
              </View>
              <View style={styles.shoppingCotainer}>
                <TouchableOpacity style={styles.shoppingbody}>
                  <View style={styles.shoppingtxt}>
                    <Icon
                      family="MaterialIcons"
                      name="music-note"
                      size={20}
                      color={mainColor}
                    />
                  </View>
                  <Text style={styles.shoptxt}>Music</Text>
                </TouchableOpacity>
                <TouchableOpacity style={styles.shoppingbody}>
                  <View style={styles.shoppingtxt}>
                    <Icon
                      family="MaterialIcons"
                      name="mic"
                      size={20}
                      color={mainColor}
                    />
                  </View>
                  <Text style={styles.shoptxt}>Singing</Text>
                </TouchableOpacity>

                <TouchableOpacity style={styles.shoppingbody}>
                  <View style={styles.shoppingtxt}>
                    <Icon
                      family="MaterialIcons"
                      name="mic"
                      size={20}
                      color={mainColor}
                    />
                  </View>
                  <Text style={styles.shoptxt}>Singing</Text>
                </TouchableOpacity>
              </View>
              <View style={styles.shoppingCotainer}>
                <TouchableOpacity style={styles.shoppingbody}>
                  <View style={styles.shoppingtxt}>
                    <Icon
                      family="FontAwesome"
                      name="edit"
                      size={20}
                      color={mainColor}
